import './MainPage.css'

function MainPage() {
  return (
    <main className="main-body">
      <div className="bg-main">
      .main-
        <h2 className="main-hedding">birnima birnimala</h2>
        <p className="main-paragrf">Lorem ipsum dolor sit amet consectetur adipisicing elit. </p>
        <button className="start-register">GET START</button>
      </div>
    </main>
  );
}

export default MainPage;
